<div class="entities" style="line-height: 2.5; direction: ltr">Gene transcription abnormalities in canine atopic dermatitis and related human eosinophilic allergic diseases . Canine atopic dermatitis ( AD ) is clinically similar to human AD , implicating it as a useful model of human eosinophilic allergic disease . To identify cutaneous gene transcription changes in relatively early inflammation of canine AD , microarrays were used to monitor transcription in normal skin ( n = 13 ) and in acute lesional AD (

</mark>
 ) and nearby visibly nonlesional AD ( NLAD ) skin ( n = 13 ) from dogs . Scanning the putative abnormally transcribed genes , several potentially relevant genes , some abnormally transcribed in both NLAD and

    P13716
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ( e . g .

 , Q8NET5 , Q9UJ68 , and

 ) , were observed . Comparison for abnormally transcribed genes common to two related human diseases , human AD and asthmatic chronic rhinosinusitis with nasal polyps ( aCRSwNP ) , further identified genes or gene sets likely relevant to eosinophilic allergic inflammation . These included : ( 1 ) genes associated with alternatively activated monocyte-derived cells , including members of the monocyte chemotactic protein ( MCP ) gene cluster , ( 2 ) members of the IL1 family gene cluster , ( 3 ) eosinophil-associated seven transmembrane receptor

 and Q9BY15 genes , ( 4 ) interferon-inducible genes , and ( 5 ) keratin genes associated with hair and nail formation . Overall , numerous abnormally transcribed genes were observed only in canine AD ; however , many others are common to related human eosinophilic allergic diseases and represent therapeutic targets testable in dogs with AD .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">

</mark>
 for the treatment of primary myelofibrosis . PURPOSE : The pharmacology , pharmacokinetics , pharmacogenomics , clinical efficacy , and safety profile of ruxolitinib for the treatment of primary myelofibrosis are reviewed . SUMMARY : 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB08877
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 , an oral tyrosine kinase inhibitor that targets the Janus-associated kinases ( JAKs ) 1 and 2 , has been recently approved for the treatment of patients with intermediate - or high-risk myelofibrosis . Unlike previous treatment options for patients with myelofibrosis , ruxolitinib offers a targeted therapy option for these patients who often suffer with severe and debilitating symptoms associated with the disease process . After oral administration , ruxolitinib is rapidly absorbed and can be given without regard to meals . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB08877
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 is primarily metabolized by the cytochrome P - 450 ( CYP ) 3A4 isoenzyme system ; therefore , if concomitant use with a strong 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P08684
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 inhibitor is unavoidable , an initial dosage reduction is warranted . Two Phase III randomized trials comparing ruxolitinib to either placebo or best available therapy found a rapid and sustained response in the reduction of spleen size and improvements in constitutional symptoms and quality of life , with one study demonstrating an improvement in overall survival . The most commonly reported serious adverse effects of ruxolitinib are anemia and thrombocytopenia . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB08877
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 is administered as an oral tablet given twice daily , with the initial starting dosage based on the baseline platelet count . Dosage reductions are based on the development of thrombocytopenia . CONCLUSION : By directly targeting both

 and

<h2 style="margin: 0">9</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Novel treatments of GERD : focus on the lower esophageal sphincter . Up to 50 % of patients with gastroesophageal reflux disease ( GERD ) still suffer from GERD symptoms despite proton pump inhibitor ( PPI ) therapy , indicating a need for new treatments . The lower esophageal sphincter ( LES ) plays a crucial role in maintaining the mechanical barrier necessary for prevention of gastric reflux . Transient LES relaxation ( TLESR ) is an important factor behind the occurrence of reflux , and preclinical studies have identified a number of targets for pharmacologic modification of TLESR . However , only gamma-aminobutyric acid ( GABA ) type B receptor ( GABA ( B ) ) agonists and metabotropic glutamate receptor 5 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) modulators have shown positive proof of concept in the clinical setting . The 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P41594

</mark>
 negative allosteric modulator 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB05070
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 improved symptoms in GERD patients , but was associated with central side effects such as dizziness . DB00181 , a GABA ( B ) receptor agonist , reduces the incidence of TLESR and improves GERD symptoms in both adult and pediatric GERD patients . However , the utility of baclofen is similarly limited by poor tolerability and recent research has focused on the development of GABA ( B ) receptor agonists with improved tolerability . DB05031 , a prodrug of R-baclofen , reduced the number of reflux episodes in a dose-ranging study and was similarly tolerated to placebo . AZD 3355 and AZD 9343 are GABA ( B ) receptor agonists with limited central nervous system activity that have been shown in preclinical studies to reduce the incidence of TLESR and decrease esophageal acid exposure ; data from clinical studies of these agents in GERD patients are awaited with interest . Agents that target TLESR activity may therefore offer a promising new add-on treatment for patients who suffer from GERD symptoms despite PPI therapy .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Role of the JAK - P35610 pathway in protection against myocardial ischemia / reperfusion injury . The Janus kinase ( JAK ) - signal transducers and activators of transcription ( P35610 ) pathway is a stress-responsive mechanism that transduces signals from the cell surface to the nucleus , thereby modulating gene expression . Recent studies have demonstrated that myocardial ischemia and reperfusion induce rapid activation of this pathway . Although the functional consequences of this event remain to be elucidated , there is emerging evidence that JAK - P35610 signaling plays an important role in the development of the cardioprotected phenotype associated with ischemic preconditioning . Specifically , brief episodes of myocardial ischemia / reperfusion activate

 , followed by recruitment of

 , resulting in transcriptional upregulation of inducible nitric oxide synthase (

<div class="entities" style="line-height: 2.5; direction: ltr">Altered gene expression in the spleen of adolescent rats following high ethanol concentration binge drinking . Binge drinking of alcoholic beverages among adolescents is a common practice that can have serious health consequences . DB00898 is a potent immunomodulator that alters a wide range of immune responses . However , it is unclear whether there is a differential immune response to alcoholic beverages with a high versus low concentration of ethanol . In this study , we used a PCR array containing 46 primer pairs of selected genes to compare mRNA expression in the spleen , an immune system organ , of adolescent rats following binge drinking of alcohol solutions containing either 20 % or 52 % ethanol ( v / v , 4.8 g / kg daily dosage ) , or water ( control ) for 3 d . We found that , expression of IL - 1β ,

 ,

 , and GABA ( A ) receptor α2 subunit in the spleen were decreased , and

 and

<div class="entities" style="line-height: 2.5; direction: ltr">Efficacy and safety of repeated dosing of netupitant , a neurokinin - 1 receptor antagonist , in treating overactive bladder . AIM : NK - 1 receptors in sensory nerves , the spinal cord and bladder smooth muscle participate in complex sensory mechanisms that regulate bladder activity . This study was designed to assess the efficacy and safety of a new 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P25103
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 antagonist , netupitant , in patients with OAB . METHODS : This was a phase II , multicenter , double-blind study in which adults with OAB symptoms &gt; 6 months were randomized to receive 1 of 3 doses of netupitant ( 50 , 100 , 200 mg ) or placebo once daily for 8 weeks . The primary efficacy endpoint was percentage change from baseline in average number of daily micturitions at week 8 . Urinary incontinence , urge urinary incontinence ( UUI ) , and urgency episodes were also assessed . RESULTS : The primary efficacy endpoint was similar in the treatment groups ( -13.85 for placebo to -16.17 in the netupitant 200 mg group ) with no statistically significant differences between netupitant and placebo . The same was true for most secondary endpoints although a significant difference for improvement in UUI episodes and a trend for the greatest decrease in urgency episodes were seen in the netupitant 100 mg group . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #CC9966); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>

<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 was well tolerated with most treatment emergent adverse events ( AEs ) being mild . While the overall incidence of AEs increased with netupitant dose , there was no evidence for this dose dependency based on relationship to treatment , intensity , or time to onset . CONCLUSIONS : The study failed to demonstrate superiority of netupitant versus placebo in decreasing OAB symptoms , despite a trend favoring netupitant 100 mg . There were no safety concerns with daily administration of netupitant over 8 weeks .</div>

 and Janus kinase (

 . Chronic obstructive pulmonary disease , characterised by a slowly progressive , irreversible airways limitation , is a major worldwide cause of chronic morbidity and mortality . The imbalance between human neutrophil elastase and endogenous antiproteases may cause excess human neutrophil elastase in pulmonary tissues , which may be considered a major pathogenic factor in chronic obstructive pulmonary disease . Great effort has been devoted to finding a method to restore the balance , resulting in the discovery of potent two-typed small-molecular-weight human neutrophil elastase inhibitors . In the application of chronic obstructive pulmonary disease therapy , the human neutrophil elastase inhibitors mainly focused upon include ONO - 5046 , MR - 889 , L -694,458 , CE - 1037 , GW - 311616 and TEI - 8362 as the acyl-enzyme inhibitors ; and
